const BASE_URL = 'http://localhost:8081';

var base64Image = "";
document.getElementById("upload").addEventListener("change", function () {

    const file = this.files[0];
    if (file === null || file === undefined) {
        return;
    }
    const reader = new FileReader();
    reader.onload = function (e) {
        base64Image = e.target.result;
        document.getElementById("uploadedAvatar").setAttribute("src", base64Image);
    }
    reader.readAsDataURL(file);
})



function createUser(event){
    event.preventDefault();

    // Lấy thông tin từ form và tạo đối tượng userRequest
    let userRequest = {
        username: document.getElementById("username").value,
        password: document.getElementById("password").value,
        firstName: document.getElementById("firstName").value,
        lastName: document.getElementById("lastName").value,
        email: document.getElementById("email").value,
        phoneNumber: document.getElementById("phone").value,
        address: document.getElementById("address").value,
        age: document.getElementById("age").value,
        avatarStringBase64: base64Image !== "" ? base64Image : defaultAvatar
    }

    let json = JSON.stringify(userRequest);
    let url = BASE_URL + '/api/v1/users';

    fetch(url,{
        method: 'POST',
        body: json,
        headers: {
            'Content-Type': 'application/json'
        }
    }).then(response => {
        if (!response.ok){
            return Promise.reject(response.json());
        }
        return response.text();
    }).then(bodyResponse => {
        alert("Tạo mới user với username " + bodyResponse + " thành công");
        window.location.href = BASE_URL + '/cms/user-manager';
    },error => {
        error.then(err => {
            alert("Tạo mới user thất bại: " + err.message);
        })
    })

}


var defaultAvatar = "data:image/jpeg;base64,";